import React from 'react'
import { View, Text } from 'react-native'
import tw from "twrnc";

export default function OrderTabBar() {
  return (
    <View
    style={tw`bg-red-500 w-full`}
    >
        <Text>Order Tab Bar </Text>
    </View>
  )
}
